problem:
Find the number of ordered triples $(x,y,z)$ of real numbers such that
\begin{align*}
x + 2y + 4z &= 12, \\
xy + 2xz + 4yz &= 22, \\
xyz &= 6.
\end{align*}

In how many ways can seven beads of distinct colors be put on the hexagonal grid shown, if reflections and rotations of an arrangement are considered equivalent?

[asy]
size(50);
dot((0,0));
dot((1,0));
dot((-1,0));
dot((.5,sqrt(3)/2));
dot((.5,-sqrt(3)/2));
dot((-.5,sqrt(3)/2));
dot((-.5,-sqrt(3)/2));
[/asy]
